import sttp.client4.Response object Weather { def temp() = { val response: Response[String] = quickRequest .get( uri"https://api.open-meteo.com/v1/forecast?latitude=40.7143&longitude=-74.006&current_weather=true" ) .send() val json = ujson.read(response.body) json.obj("current_weather")("temperature").num }
} Next, change src/main/scala/example/Hello.scala as follows: package example import example.core.Weather object Hello { def main(args: Array[String]): Unit = { val temp = Weather.temp() println(s"Hello! The current temperature in New York is \$temp C.") }
